sources.styles/blocks/header.scss:
.header {
  box-sizing: border-box;
  padding-top: 18px;

  @include onTablet {
    padding-top: 20px;
  } 

  @include onDesktop {
    padding-top: 48px;
  } 

  background-color: $dark-gray;
  border-bottom-left-radius: 30px;
  border-bottom-right-radius: 30px;

  &__info {
    display: flex;
    justify-content: space-between;
    flex-direction: column;

    @include onDesktop {
      flex-direction: row;
      gap: 106px;
    }

    @include onLargeDesktop {
      flex-direction: row;
      gap: 324px;
    }
  }

  &__top {
    display: flex;
    align-items: center;
    justify-content: space-between;

    @include onDesktop {
      padding-bottom: 48px;
      gap: 114px;
    }

    @include onLargeDesktop {
      gap: 229px;
    }
  }

  &__logo {
    display: flex;
    justify-content: space-between;
    align-items: center;
    gap: 32px;
    @include onDesktop {
      gap: 0;
    }
  }

  &__menu {
    @include onMobile {
      display: none;
    }

    @include onTablet {
      padding-inline-start: 0;
      display: none;
    }

    @include onDesktop {
      display: flex;
    }

    &__list {
      display: flex;
      gap: 48px;
      list-style: none;
      padding-inline-start: 0;
    }

    &__item {
      display: flex;
      color: $white;
    }

    &__item:hover {
      color: $blue;
    }
  }

  &__hire {
    color: $white;
    text-align: center;
    border-bottom: 4px solid $blue;
  }

  &__title {
    font-weight: 600;
    letter-spacing: -2px;

    font-size: 64px;
    line-height: 68px;

    @include onMobile {
      line-height: 120%;
      font-size: 52px;
    }
  }

  &__content {
    display: flex;
    flex-direction: column;
    gap: 32px;
    padding: 48px 0 48px 20px;

    @include onTablet {
      gap: 24px;
      padding: 56px 0 147px 41px;
    }

    @include onDesktop {
      gap: 32px;
      padding-top: 168px;
      padding-left: 54px;
    }

    @include onLargeDesktop {
      padding-left: 227px;
    }

    @include onLargeScreen {
      padding-left: 707px;
    }
    color: $white;
    font-size: 18px;
    text-align: left;
  }

  &__text {
    width: 280px;

    @include onTablet {
      width: 362px;
    }
  }

  &__bottom {
    padding-top: 250px;
    padding-bottom: 24px;
    box-sizing: border-box;
    height: 390px;
    border-radius: 30px;

    @include onTablet {
      padding-top: 242px;
      padding-bottom: 32px;
    }

    @include onDesktop {
      display: flex;
      gap: 24px;
      padding: 564px 54px 48px 78px;
      border-bottom-left-radius: 0;
      border-top-right-radius: 0;
      border-bottom-right-radius: 30px;
      overflow-x: hidden;
      height: 680px;
      width: 502px;
    }

    @include onLargeDesktop {
      width: 687px;
    }

    @include onLargeScreen {
      width: 1167px;
    }

    background-size: cover;
    background-position: center;
    background-image: url(../images/slider/slide-img-1.png);
    color: $white;

    &__info {
      padding-top: 8px;
      color: $white;
      text-align: left;
      width: 280px;
    }
  }

  &__button {
    display: flex;
    justify-content: center;

    @include onTablet {
      justify-content: left;
    }
  }
  &__arrows {
    display: flex;
    align-items: center;
    gap: 16px;
    width: 80px;
    padding-bottom: 16px;

    @include onDesktop {
      padding-bottom: 0;
    }
  }

